import React, { Component } from 'react';

import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

import Contact from './Pages/Contact';
import Porfolio from './Pages/Portfolio';
import Home from './Pages/Home';

class App extends Component {


  render() {
  return (
    <Router>
    <div className="App">  
      <Navbar bg="light" expand="lg">
        <Navbar.Brand href="#home">Gretchen Krammes</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link tag={Link} to="/">Home</Nav.Link>
          <Nav.Link tag={Link} to="/Portfolio">Portfolio</Nav.Link>
          <Nav.Link tag={Link} to="/Contact">Contact</Nav.Link>
        </Nav>
        </Navbar.Collapse>
      </Navbar>
        <aside className='sidebar'>
        <img></img>

        <p>Full stack web developer leveraging experience in sales and customer service to build a better and more responsive user experience. Recently earned a professional certificate in full stack coding from Butler University, with recently developed skills in React, JavaScript, Css, and website responsiveness. Interested in expanding knowledge and experience to grow into a successful career in UX/UI design.</p>
        </aside>      
    </div>
    </Router>
  );
}
}

export default App;
